function ProductsPage() {
    return ( 
        <div>
            <Hero/>
            <LeftSection  imageURL="" productName="Kite" productDescription=""
            tryDemo="" learnMore=""
   googlePlay=""
  appStore=""/>
            <RightSection/>
            <Universe/>
        </div>
     );
}

export default ProductsPage;
